// Get the HTML response and lead data
const html = $input.first().json || '';
const lead = $('Query Raw Leads').item.json;

// Function to clean HTML
function cleanHTML(html) {
  if (typeof html !== 'string') {
    return '';
  }

  // Remove script tags and content
  let cleaned = html.replace(/<script\b[^<]*(?:(?!<\/script>)<[^<]*)*<\/script>/gi, '');

  // Remove style tags and content
  cleaned = cleaned.replace(/<style\b[^<]*(?:(?!<\/style>)<[^<]*)*<\/style>/gi, '');

  // Remove HTML tags
  cleaned = cleaned.replace(/<[^>]+>/g, ' ');

  // Decode common HTML entities
  cleaned = cleaned
    .replace(/&nbsp;/g, ' ')
    .replace(/&amp;/g, '&')
    .replace(/&lt;/g, '<')
    .replace(/&gt;/g, '>')
    .replace(/&quot;/g, '"')
    .replace(/&#39;/g, "'");

  // Remove extra whitespace
  cleaned = cleaned.replace(/\s+/g, ' ').trim();

  return cleaned;
}

// Function to extract metadata
function extractMetadata(html) {
  const metadata = {
    title: '',
    description: '',
    keywords: []
  };

  if (typeof html !== 'string') {
    return metadata;
  }

  // Extract title
  const titleMatch = html.match(/<title[^>]*>([^<]+)<\/title>/i);
  if (titleMatch) {
    metadata.title = titleMatch[1].trim();
  }

  // Extract meta description
  const descMatch = html.match(/<meta[^>]*name=["']description["'][^>]*content=["']([^"']+)["']/i);
  if (descMatch) {
    metadata.description = descMatch[1].trim();
  }

  // Extract keywords
  const keywordsMatch = html.match(/<meta[^>]*name=["']keywords["'][^>]*content=["']([^"']+)["']/i);
  if (keywordsMatch) {
    metadata.keywords = keywordsMatch[1].split(',').map(k => k.trim()).filter(Boolean);
  }

  return metadata;
}

// Process the HTML
const htmlContent = html.body || html.data || html.toString() || '';
const metadata = extractMetadata(htmlContent);
const cleanedText = cleanHTML(htmlContent);

// Truncate content to avoid token limits (first 3000 chars)
const truncatedText = cleanedText.substring(0, 3000);

console.log(`Processed ${lead.domain}: ${cleanedText.length} chars cleaned, ${truncatedText.length} used`);

return [{
  json: {
    lead_id: lead.id,
    batch_id: lead.batch_id,
    user_id: lead.user_id,
    domain: lead.domain,
    name: lead.name || 'Unknown',

    // Metadata
    title: metadata.title || lead.name || 'No title',
    description: metadata.description || 'No description',
    keywords: metadata.keywords,

    // Content for analysis
    content: truncatedText,
    content_length: cleanedText.length,

    // Original lead data
    original_lead: lead
  }
}];

