// Get the LLM response and lead data
const llmResponse = $input.first().json;
const leadData = $('Extract & Clean Content').item.json;

// Extract content from Claude response
let analysisText = '';
if (llmResponse.content && Array.isArray(llmResponse.content)) {
  analysisText = llmResponse.content
    .filter(block => block.type === 'text')
    .map(block => block.text)
    .join('\n');
} else if (typeof llmResponse === 'string') {
  analysisText = llmResponse;
}

console.log('LLM Response:', analysisText.substring(0, 200));

// Parse JSON from response
let analysis;
try {
  // Remove markdown code blocks if present
  let cleanedText = analysisText.replace(/```json\n?/g, '').replace(/```\n?/g, '');

  // Find JSON object
  const jsonMatch = cleanedText.match(/\{[\s\S]*\}/);
  if (jsonMatch) {
    analysis = JSON.parse(jsonMatch[0]);
  } else {
    throw new Error('No JSON found in response');
  }
} catch (e) {
  console.error('Failed to parse LLM response:', e.message);

  // Fallback: extract score from text
  const scoreMatch = analysisText.match(/fit[_\s]*score[:\s]*(\d+)/i);
  const score = scoreMatch ? parseInt(scoreMatch[1]) : 50;

  analysis = {
    fit_score: score,
    summary: analysisText.substring(0, 500) || 'Analysis failed - using default score',
    pros: ['Unable to extract detailed analysis'],
    cons: ['LLM response parsing failed'],
    recommended_action: 'research_more',
    legitimacy_score: Math.round(score * 0.25),
    quality_score: Math.round(score * 0.25),
    relevance_score: Math.round(score * 0.25),
    contact_score: Math.round(score * 0.25)
  };
}

// Ensure score is valid (0-100)
const fitScore = Math.max(0, Math.min(100, parseInt(analysis.fit_score) || 50));

console.log(`Scored ${leadData.domain}: ${fitScore}/100`);

return [{
  json: {
    lead_id: leadData.lead_id,
    batch_id: leadData.batch_id,
    domain: leadData.domain,

    // Scoring
    fit_score: fitScore,
    legitimacy_score: analysis.legitimacy_score || null,
    quality_score: analysis.quality_score || null,
    relevance_score: analysis.relevance_score || null,
    contact_score: analysis.contact_score || null,

    // Analysis
    summary: (analysis.summary || 'No summary available').substring(0, 1000),
    pros: Array.isArray(analysis.pros) ? analysis.pros.slice(0, 5) : [],
    cons: Array.isArray(analysis.cons) ? analysis.cons.slice(0, 5) : [],
    recommended_action: analysis.recommended_action || 'research_more',

    // Metadata
    analyzed_at: new Date().toISOString(),
    llm_model: llmResponse.model || 'claude-3-5-sonnet',

    // Store full analysis
    full_analysis: analysis
  }
}];

// Get batch_id from processed lead
const batchId = $json.batch_id;

if (!batchId) {
  console.log('No batch_id found, skipping batch check');
  return [];
}

console.log(`Checking completion for batch: ${batchId}`);

return [{
  json: {
    batch_id: batchId
  }
}];

// Get all leads in batch
const allLeads = $input.all().map(item => item.json);
const batchId = $('Check Batch').item.json.batch_id;

if (allLeads.length === 0) {
  console.log('No leads found in batch');
  return [{ json: { complete: false, skip: true } }];
}

// Count leads by status
const statusCounts = {
  raw: 0,
  enriching: 0,
  scored: 0,
  scraping_failed: 0
};

allLeads.forEach(lead => {
  const status = lead.status || 'unknown';
  if (statusCounts.hasOwnProperty(status)) {
    statusCounts[status]++;
  }
});

// Batch is complete if no raw or enriching leads remain
const isComplete = (statusCounts.raw + statusCounts.enriching) === 0;

// Calculate stats
const totalLeads = allLeads.length;
const scoredLeads = statusCounts.scored;

// Calculate average score (only for scored leads with valid scores)
const scoredLeadsWithScores = allLeads.filter(
  l => l.status === 'scored' && l.fit_score !== null && !isNaN(l.fit_score)
);

const avgScore = scoredLeadsWithScores.length > 0
  ? Math.round(
      scoredLeadsWithScores.reduce((sum, l) => sum + parseFloat(l.fit_score), 0) / 
      scoredLeadsWithScores.length
    )
  : 0;

console.log(`Batch ${batchId}: ${isComplete ? 'COMPLETE' : 'PENDING'}`);
console.log(`Status: Raw=${statusCounts.raw}, Enriching=${statusCounts.enriching}, Scored=${statusCounts.scored}, Failed=${statusCounts.scraping_failed}`);
console.log(`Average score: ${avgScore}`);

return [{
  json: {
    batch_id: batchId,
    complete: isComplete,
    total_leads: totalLeads,
    scored_leads: scoredLeads,
    failed_leads: statusCounts.scraping_failed,
    pending_leads: statusCounts.raw + statusCounts.enriching,
    average_score: avgScore,
    status_breakdown: statusCounts
  }
}];

// Handle scraping errors
const error = $input.first().json.error || {};
const errorNode = error.node || 'unknown';
const errorMessage = error.message || 'Unknown error';

// Try to get lead_id from context
let leadId = null;
let batchId = null;

try {
  const queryResult = $('Query Raw Leads').item;
  if (queryResult) {
    leadId = queryResult.json.id;
    batchId = queryResult.json.batch_id;
  }
} catch (e) {
  console.warn('Could not retrieve lead_id from context');
}

console.error('Workflow error:', {
  node: errorNode,
  message: errorMessage,
  lead_id: leadId
});

return [{
  json: {
    lead_id: leadId,
    batch_id: batchId,
    error_node: errorNode,
    error_message: errorMessage.substring(0, 500),
    error_stack: error.stack ? error.stack.substring(0, 1000) : null,
    timestamp: new Date().toISOString()
  }
}];
